/*Table structure for table `catalogue_page` */

DROP TABLE IF EXISTS `catalogue_page`;

CREATE TABLE `catalogue_page` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(200) DEFAULT NULL,
  `photo` int(11) DEFAULT NULL,
  `pagenum` int(11) DEFAULT NULL,
  `title` varchar(200) DEFAULT NULL,
  `catalogue_id` int(11) DEFAULT NULL,
  `retailer_id` int(11) DEFAULT NULL,
  `createdBy` varchar(50) DEFAULT NULL,
  `updatedBy` varchar(50) DEFAULT NULL,
  `createdDate` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updatedDate` timestamp NULL DEFAULT '2013-01-01 00:00:01',
  `version` int(11) DEFAULT NULL,
  `photo_thumb` int(11) DEFAULT NULL,
  `photo_mini` int(11) DEFAULT NULL,
  `photo_path` varchar(160) DEFAULT NULL,
  `photo_thumb_path` varchar(180) DEFAULT NULL,
  `photo_mini_path` varchar(180) DEFAULT NULL,
  `enabled` tinyint(1) DEFAULT '1',
  `height` int(11) DEFAULT '1',
  `width` int(11) DEFAULT '1',
  `count` int(11) DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `fk_catalogue_page_catalogue` (`catalogue_id`),
  KEY `fk_cata_page_photo` (`photo`),
  KEY `fk_cata_page_photo_thumb` (`photo_thumb`),
  KEY `fk_cata_page_photo_mini` (`photo_mini`),
  CONSTRAINT `fk_catalogue_page_catalogue` FOREIGN KEY (`catalogue_id`) REFERENCES `catalogue` (`id`),
  CONSTRAINT `fk_cata_page_photo` FOREIGN KEY (`photo`) REFERENCES `filestore` (`id`),
  CONSTRAINT `fk_cata_page_photo_mini` FOREIGN KEY (`photo_mini`) REFERENCES `filestore` (`id`),
  CONSTRAINT `fk_cata_page_photo_thumb` FOREIGN KEY (`photo_thumb`) REFERENCES `filestore` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=167 DEFAULT CHARSET=latin1;

