  `id` int(11) NOT NULL AUTO_INCREMENT,
  `catalogue_id` int(11) DEFAULT NULL,
  `store_id` int(11) DEFAULT NULL,
  `name` varchar(10) DEFAULT NULL,
  `retailer_id` int(11) DEFAULT NULL,
  `createdBy` varchar(50) DEFAULT NULL,
  `updatedBy` varchar(50) NOT NULL,
  `createdDate` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updatedDate` timestamp NULL DEFAULT '2013-01-01 00:00:01',
  `version` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_catalogue_store_mapping_catalogue` (`catalogue_id`),
  KEY `fk_catalogue_store_mapping_store` (`store_id`),
  KEY `fk_catalogue_store_mapping_retailer` (`retailer_id`),
  CONSTRAINT `fk_catalogue_store_mapping_catalogue` FOREIGN KEY (`catalogue_id`) REFERENCES `catalogue` (`id`),
  CONSTRAINT `fk_catalogue_store_mapping_retailer` FOREIGN KEY (`retailer_id`) REFERENCES `retailer` (`id`),
  CONSTRAINT `fk_catalogue_store_mapping_store` FOREIGN KEY (`store_id`) REFERENCES `store` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=67 DEFAULT CHARSET=latin1;

