/*Table structure for table `deal` */

DROP TABLE IF EXISTS `deal`;

CREATE TABLE `deal` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(150) DEFAULT NULL,
  `code` varchar(20) DEFAULT NULL,
  `photo` int(11) DEFAULT NULL,
  `product_id` int(11) DEFAULT NULL,
  `page_id` int(11) DEFAULT NULL,
  `brand_id` int(11) DEFAULT NULL,
  `catalogue_id` int(11) DEFAULT NULL,
  `category_id` int(11) DEFAULT NULL,
  `subcategory_id` int(11) DEFAULT NULL,
  `retailer_id` int(11) DEFAULT NULL,
  `expiry_date` datetime DEFAULT NULL,
  `type` varchar(50) DEFAULT NULL,
  `createdBy` varchar(50) DEFAULT NULL,
  `updatedBy` varchar(50) DEFAULT NULL,
  `createdDate` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updatedDate` timestamp NULL DEFAULT '2013-01-01 00:00:01',
  `version` int(11) DEFAULT NULL,
  `premium` tinyint(1) DEFAULT NULL,
  `photo_path` varchar(160) DEFAULT NULL,
  `photo_catalogue_mini_path` varchar(180) DEFAULT NULL,
  `photo_catalogue_mini` int(11) DEFAULT NULL,
  `photo_catalogue_thumb` int(11) DEFAULT NULL,
  `photo_catalogue_thumb_path` varchar(180) DEFAULT NULL,
  `enabled` tinyint(1) DEFAULT '1',
  `count` int(11) DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `fk_deal_product` (`product_id`),
  KEY `fk_deal_page` (`page_id`),
  KEY `fk_deal_brand` (`brand_id`),
  KEY `fk_deal_catalogue` (`catalogue_id`),
  KEY `fk_deal_category` (`category_id`),
  KEY `fk_deal_subcategory` (`subcategory_id`),
  KEY `fk_deal_retailer` (`retailer_id`),
  KEY `fk_deal_photo` (`photo`),
  KEY `fk_deal_photo_catalogue_mini` (`photo_catalogue_mini`),
  KEY `fk_deal_photo_catalogue_thumb` (`photo_catalogue_thumb`),
  CONSTRAINT `fk_deal_brand` FOREIGN KEY (`brand_id`) REFERENCES `master_brand` (`id`),
  CONSTRAINT `fk_deal_catalogue` FOREIGN KEY (`catalogue_id`) REFERENCES `catalogue` (`id`),
  CONSTRAINT `fk_deal_category` FOREIGN KEY (`category_id`) REFERENCES `master_category` (`id`),
  CONSTRAINT `fk_deal_photo` FOREIGN KEY (`photo`) REFERENCES `filestore` (`id`),
  CONSTRAINT `fk_deal_photo_catalogue_mini` FOREIGN KEY (`photo_catalogue_mini`) REFERENCES `filestore` (`id`),
  CONSTRAINT `fk_deal_photo_catalogue_thumb` FOREIGN KEY (`photo_catalogue_thumb`) REFERENCES `filestore` (`id`),
  CONSTRAINT `fk_deal_product` FOREIGN KEY (`product_id`) REFERENCES `master_product` (`id`),
  CONSTRAINT `fk_deal_retailer` FOREIGN KEY (`retailer_id`) REFERENCES `retailer` (`id`),
  CONSTRAINT `fk_deal_subcategory` FOREIGN KEY (`subcategory_id`) REFERENCES `master_subcategory` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=225 DEFAULT CHARSET=latin1;

