/*Table structure for table `mail` */

DROP TABLE IF EXISTS `mail`;

CREATE TABLE `mail` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `toEmail` varchar(90) DEFAULT NULL,
  `fromEmail` varchar(90) DEFAULT NULL,
  `subject` varchar(256) DEFAULT NULL,
  `content` varchar(2048) DEFAULT NULL,
  `textFormat` tinyint(1) DEFAULT NULL,
  `cc` varchar(30) DEFAULT NULL,
  `bcc` varchar(30) DEFAULT NULL,
  `status` int(11) DEFAULT NULL,
  `enqueuedAt` datetime DEFAULT NULL,
  `sentAt` datetime DEFAULT NULL,
  `mailsendAttempt` int(11) DEFAULT NULL,
  `batchId` int(11) DEFAULT NULL,
  `emailTemplateId` int(11) DEFAULT NULL,
  `createdBy` varchar(50) DEFAULT NULL,
  `updatedBy` varchar(50) DEFAULT NULL,
  `createdDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updatedDate` timestamp NOT NULL DEFAULT '2013-01-01 00:00:01',
  `version` int(11) DEFAULT NULL,
  `name` varchar(1) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;

