insert  into `retailer`(`id`,`name`,`photo`,`description`,`createdBy`,`updatedBy`,`createdDate`,`updatedDate`,`version`,`premium`,`photo_path`,`enabled`,`description1`,`mapicon`,`mapicon_path`,`url_name`) values (11,'Suraj Business Pvt. Lmt.',66,'Suraj Business Pvt. lmt.is a multi-format food-first retailer providing a wide range of quality products to discerning young customers - well-travelled citizens of the world, looking out for authentic flavors and experiences in a fun-filled shopping environment. Our brand positioning makes Fine Living Affordable embodies this approach, delighting shoppers with the best products and services that enable a fine living at reasonable prices while providing them with a warm, friendly and knowledgeable retail environment.','anonymousUser','anonymousUser','2014-04-30 00:00:51','2014-06-23 01:01:18',0,1,'/images/retailer//14/04/30/suraj_20140204123923.jpg',1,'Suraj Business Pvt. Ltd. is a mobile phone dealer. The shop is run by Narendar Yadav and deals in popular brands like Samsung, Nokia, Blackberry, Apple and various others. With the increased demand in the mobile phone market, Suraj Business Pvt. Ltd. sells authorized products from major manufacturers, accepts leading credit and debit cards and exchanges your old mobile phones when you purchase a new mobile.',NULL,NULL,'suraj-electronics'),(12,'Spencer\'s',67,'A food first retailer we offer both fresh and packaged foods as well as groceries. We also have a wide selection of electronics and electrical equipment, home and office essentials, garments and fashion accessories, toys, and personal care','anonymousUser','anonymousUser','2014-04-30 00:02:03','2014-05-22 04:35:01',0,1,'/images/retailer//14/04/30/357_7313_spencers.jpg',1,NULL,NULL,NULL,NULL),(13,'Pantaloons',70,'Pantaloons Fashion & Retail Limited is an Indian premium clothing retail chain. The first Pantaloons store was launched in Gariahat, Kolkata in 1997. As of November 2013, there are 76 Pantaloons stores in 44 cities. Pantaloons was previously controlled by the Future Group, but has now been taken over by Aditya Birla Nuvo Limited (ABNL)','anonymousUser','anonymousUser','2014-04-30 00:05:49','2014-05-02 23:12:52',0,1,'/images/retailer//14/04/30/pantaloons-logo-1398841599737.jpg',1,NULL,NULL,NULL,NULL),(14,'Croma',633,'Croma, the largest Electronics Megastore in India stands by its tagline we help you buy by providing its customers with a wide variety of consumer electronics and durables to choose from. Croma strives to provide better service with a nation-wide network of several Croma and Croma Zip stores, along with its latest online vertical - Cromaretail.com.','anonymousUser','anonymousUser','2014-04-30 00:13:31','2014-05-26 22:57:34',0,1,'/images/retailer//14/05/26/croma_2.jpg',1,NULL,NULL,NULL,NULL),(15,'Family Dollar',72,'Welcome to Family Dollar Stores, your neighborhood dollar discount store, where you\'ll find the products you and your family need the most at the lowest prices. From groceries, to health and beauty products, to household goods and clothing, Family Dollar stores carry national brands at incredible savings.','anonymousUser','anonymousUser','2014-04-30 00:15:56','2014-05-07 21:41:11',0,1,'/images/retailer//14/04/30/family-dollar-logo.jpg',1,NULL,NULL,NULL,NULL),(16,'Ritu Wears',637,'Ritu Wears Biglife - the biggest family store chain in North and Central India and a leading name in Delhi?????????????????????????????????????????????????????????s fashion industry. \r\nIn the rapidly evolving retail scenario, Ritu Wears Biglife has successfully carved a niche for its brand of merchandise, which today has a loyal following. Currently, the group owns outlets in Delhi & NCR, Punjab, Madhya Pradesh and Uttar Pradesh.','anonymousUser','anonymousUser','2014-05-11 00:07:27','2014-05-26 23:03:37',0,1,'/images/retailer//14/05/26/ritu-wears-logo 2-1401170616980.png',1,NULL,NULL,NULL,NULL);

